        var fb_guide = document.getElementsByClassName("guide")[0].value;
        // 中文引导语
        var fb_cn_guide = document.getElementsByClassName("cn_guide")[0].value;
        // 图片来源
        var fn_image_origin = getSheetName("posting_status");
